def knapsack(backpack, max_weight=4):
    weight = 0
    value = 0
    for i, b in enumerate(backpack):
        weight += b * _KNAPSACK[i][0]
        value += b * _KNAPSACK[i][1]

    if weight > max_weight:
        return max_weight - weight
    return value

